import React, { useEffect } from "react";
import { useFetch } from "../../hooks.js/useFetch";
import Styled from "./Admin.module.scss";
import { Route, Routes } from "react-router-dom";

const Admin = () => {
  const { loading, response, error } = useFetch({
    url: "http://127.0.0.1:4000/api/v1/forms/attachPhoto",
    method: "get",
  });

  useEffect(() => {}, [response]);

  return (
    <div className={Styled.container}>
      <Routes>
        <Route path="a" element={<div></div>} />
        <Route path="b" element={<p>b</p>} />
      </Routes>
      <p>{loading ? "Loading..." : null}</p>
      {response &&
        response.forms.map((form) => (
          <div className={Styled.formBox} key={form.id}>
            <div className={Styled.imagesBox}>
              {form.file_names.map((photo, index) => (
                <img
                  key={index}
                  src={`${process.env.REACT_APP_FILES_URL}/${photo}`}
                  alt=""
                />
              ))}
            </div>
            <p>
              Имя: <span>{form.name}</span>
            </p>
            <p>
              Город: <span>{form.city}</span>
            </p>
            <p>
              Номер телефона: <span>{form.phone_number}</span>
            </p>
            <p>
              Коментарий: <span>{form.comment}</span>
            </p>
          </div>
        ))}
    </div>
  );
};

export default Admin;
